// Product13.js

import React from 'react';
import Header from './Header';
import './Product13.css';

function Product13({ navigateTo }) {
  return (
    <div className="product-detail">
      <Header navigateTo={navigateTo} />
      <div className="product-detail-content">
        <div className="product-detail-left">
          <img src="/product13.png" alt="Earthling Shampoo - Vanilla Coconut" className="product-detail-image" />
        </div>
        <div className="product-detail-right">
          <h1>Earthling Shampoo - Vanilla Coconut</h1>
          <p className="product-detail-reviews">Reviews: 4.6/5</p>
          <p className="product-detail-price">$29.99</p>
          <div className="product-detail-quantity">
            <label htmlFor="quantity">Quantity:</label>
            <input type="number" id="quantity" name="quantity" min="1" max="10" defaultValue="1" />
          </div>
          <button className="add-to-cart-btn">ADD TO CART</button>
          <p className="product-detail-description">
            Experience the ultimate refreshment with Earthling Shampoo in Vanilla Coconut scent. 
            Formulated with natural ingredients, this eco-friendly shampoo nourishes your hair and leaves it smelling delightful. 
            Perfect for all hair types.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Product13;
